import { makeStyles } from '@material-ui/core/styles';

export const homeStyles = makeStyles((theme) => ({
    section: {
        position: "relative",
        width: "100%",
        height: "100vh",
        overflow: "hidden",
        display: "flex",
        justifyContent: "center",
        alignItems: "center"
    }

}))
